webpackJsonp([0x75425e62a8c6],{1221:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2016-05-21-maker-faire/index.md absPath of file >>> MarkdownRemark",html:'<p>After a week with the Google tech elite today was a day dedicated to fun, curiosity and fascination. Callie brought Devin down Yesterday so we could spend today experiencing the inventions of the Bay Area\'s eccentric, creative, technology minds.</p>\n<p>I\'m not sure how to describe Maker Faire. There are vendors selling everything from small CNC machines to youth groups with kits. There were more 3D printers than I could count including one about 20 feet tall that could print some truely monumental sculptures.</p>\n<div class="post-images">\n  <a href="giant_3D_printer.jpg"><img src="giant_3D_printer_sm.jpg" alt="giant 3D printer"/></a>\n</div>\n<p>There were classes on how to grow from mushrooms and a truck converted into a mobile green house. There were sculptures that spewed fire, a Tesla with panels that lit up like a zebra and a giant forest of lit up inflatable astro-flower things. It was pretty cool.</p>\n<div class="post-images">\n  <a href="justin_callie.jpg"><img src="justin_callie_sm.jpg" alt="justin and callie"/></a>\n  <a href="forest.jpg"><img src="forest_sm.jpg" alt="forest"/></a>\n</div>\n<p>There was a <a href="http://www.strandbeest.com/">StrandBeest</a> which is amazing to see in person:</p>\n<div class="post-images">\n<iframe width="560" height="315" src="https://www.youtube.com/embed/BHqZEfTWhOo" frameborder="0" allowfullscreen></iframe>\n</div>\n<p>The R2D2 club was on hand to show off the droids we\'ve all been looking for:</p>\n<div class="post-images">\n  <iframe width="560" height="315" src="https://www.youtube.com/embed/lIpLIfPUmWg" frameborder="0" allowfullscreen></iframe>\n</div>\n<p>Speaking of droids here\'s the guts of a BB8 Sphero:</p>\n<div class="post-images">\n  <a href="Dalek.jpg"><img src="Dalek_sm.jpg" alt="Dalek"/></a>\n  <a href="bb8_disassembled.jpg"><img src="bb8_disassembled_sm.jpg" alt="bb8 disassembled"/></a>\n</div>\n<p>How about a Lego machine that folds paper airplanes and then launches them? There\'s Devin standing in front a giant sculpture made of tape and a T-Rex made of cardboard covered in EL-Wire.</p>\n<div class="post-images">\n  <a href="lego_paper_airplane_builder.jpg"><img src="lego_paper_airplane_builder_sm.jpg" alt="lego paper airplane builder"/></a>\n  <a href="Devin_with_Tapigami.jpg"><img src="Devin_with_Tapigami_sm.jpg" alt="Devin with Tapigami"/></a>\n  <a href="cardboard_t-rex.jpg"><img src="cardboard_t-rex_sm.jpg" alt="cardboard t-rex"/></a>\n</div>\n<p>Devin building an LED flashlight out of a popsicle stick, and LED and some conductive tape.</p>\n<div class="post-images">\n  <a href="LED_Flashlight.jpg"><img src="LED_Flashlight_sm.jpg" alt="LED Flashlight"/></a>\n</div>\n<p>Pancakes?</p>\n<div class="post-images">\n  <a href="pancake_printer.jpg"><img src="pancake_printer_sm.jpg" alt="pancake printer"/></a>\n</div>\n<p>Everyone needs a motorcycle that looks like a dragon:</p>\n<div class="post-images">\n  <a href="dragon_cycle.jpg"><img src="dragon_cycle_sm.jpg" alt="dragon cycle"/></a>\n</div>\n<p>EepyBird was on hand to cover the audience in Coke:</p>\n<div class="post-images">\n  <iframe width="560" height="315" src="https://www.youtube.com/embed/54-jSaVQABA" frameborder="0" allowfullscreen></iframe>\n</div>\n<p>Oh and there was also free Haagen-Dazs ice cream. Any event with free ice cream is a bit of awesome.</p>',frontmatter:{title:"Maker Faire",date:"May 21, 2016",image:{childImageSharp:{sizes:{src:"/static/bb8_disassembled-484e63fb8108aa7d1a76e301993f05f8-381d6.jpg"}}}}}},pathContext:{path:"/maker-faire"}}}});
